// src/components/StockList.jsx
import React from 'react';
import StockCard from './StockCard';
import '../assets/styles.css'; // Ensure global styles are imported

const StockList = () => {
  const sampleStocks = [
    { name: 'AAPL', price: 150, change: 1.2 },
    { name: 'GOOGL', price: 2800, change: -0.5 },
    { name: 'AMZN', price: 3450, change: 2.1 },
  ];

  return (
    <div className="stock-list">
      <h2 className="stock-list-heading" aria-label="Stock List">
        Stock List
      </h2>
      <div className="stock-list-container">
        {sampleStocks.map((stock, index) => (
          <StockCard key={index} stock={stock} />
        ))}
      </div>
    </div>
  );
};

export default StockList;
